import com.sunopsis.tools.core.SnpsStringTools;
import oracle.odi.mapping.generation.NullTarget;
import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTClass;
import oracle.odi.mapping.generation.AbstractSyntaxTree.SubstitutionVariables;
import oracle.odi.mapping.generation.AbstractSyntaxTree.SubstitutionVariable;
import oracle.odi.mapping.generation.AbstractSyntaxTree.SubstitutionAPIMethod;
import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;

@ASTClass(descriptionKey="ASTClass.HiveSqoopInsert")
@SubstitutionVariables([
  @SubstitutionVariable(name="HIVE_SQOOP_INSERT",type=HiveSqoopInsert.class),
])
public class HiveSqoopInsert extends NullTarget {
  String rawSourceDir;
  SqlQuery hiveUnloadQuery;

  public HiveSqoopInsert() {
    super() 
    skipGenerateTask();  // Tells the generator not to auto-generate a task for this AST.
  }

  void setRawSourceDir(String sourceDir) {
    this.rawSourceDir = sourceDir;
  }

  void setHiveUnloadQuery(SqlQuery query) {
    this.hiveUnloadQuery = query;
  }

  @SubstitutionAPIMethod(descKey="SubstitutionAPIMethod.HiveSqoopInsert.getSourceDirAsQuotedJavaString")
  public String getSourceDirAsQuotedJavaString() {
    return getQuotedJavaString(this.rawSourceDir);
  }

  @SubstitutionAPIMethod(descKey="SubstitutionAPIMethod.HiveSqoopInsert.getSourceDir")
  public String getSourceDir() {
    return this.rawSourceDir;
  }

  @SubstitutionAPIMethod(descKey="SubstitutionAPIMethod.HiveSqoopInsert.getHiveUnloadQuery")
  public SqlQuery getHiveUnloadQuery() {
    return this.hiveUnloadQuery;
  }

  @Override
  public Map<String,Object> getTemplateSubstitutionMap() {
    Map<String,Object> result = new LinkedHashMap<String,Object>();
    result.put("HIVE_SQOOP_INSERT", this)
    return result
  }

  public String getQuotedJavaString( String pString ) {
    if (pString == null) 
      return SnpsStringTools.getQuotedJavaString(new StringBuffer()).toString()
    return SnpsStringTools.getQuotedJavaString(new StringBuffer(pString)).toString()
  }

}

@GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.HiveSqoopBaseLKM")
public class HiveSqoopBaseLKM extends HiveBaseLKM {
    // class constructor; initialization is done in setBinding method
    public HiveSqoopBaseLKM() {}
    // Declare KM level vars
    protected String  option_TEMP_DIR       
    protected String  option_MAPRED_OUTPUT_BASE_DIR        
    protected boolean option_USE_GENERIC_JDBC_CONNECTOR        
    protected String  option_EXTRA_HADOOP_CONF_PROPERTIES        
    protected String  option_EXTRA_SQOOP_CONF_PROPERTIES        
    protected String  option_EXTRA_SQOOP_CONNECTOR_CONF_PROPERTIES

    public void setBinding( Binding binding ) {
        super.setBinding( binding )
        // Initialize variables
        option_TEMP_DIR                              = getOption(    "TEMP_DIR" )
        option_MAPRED_OUTPUT_BASE_DIR                = getOption(    "MAPRED_OUTPUT_BASE_DIR" )
        option_USE_GENERIC_JDBC_CONNECTOR            = isOptionTrue( "USE_GENERIC_JDBC_CONNECTOR" )
        option_EXTRA_HADOOP_CONF_PROPERTIES          = getOption(    "EXTRA_HADOOP_CONF_PROPERTIES" )
        option_EXTRA_SQOOP_CONF_PROPERTIES           = getOption(    "EXTRA_SQOOP_CONF_PROPERTIES" )
        option_EXTRA_SQOOP_CONNECTOR_CONF_PROPERTIES = getOption(    "EXTRA_SQOOP_CONNECTOR_CONF_PROPERTIES" )            
    }

    void updateBinding() {
        super.updateBinding()
        // Publish variables into binding to make them available in templates and variableDefText
    	mBinding.setVariable( "option_EXTRA_HADOOP_CONF_PROPERTIES",          option_EXTRA_HADOOP_CONF_PROPERTIES )
    	mBinding.setVariable( "option_EXTRA_SQOOP_CONF_PROPERTIES",           option_EXTRA_SQOOP_CONF_PROPERTIES )
    	mBinding.setVariable( "option_EXTRA_SQOOP_CONNECTOR_CONF_PROPERTIES", option_EXTRA_SQOOP_CONNECTOR_CONF_PROPERTIES )
    }


    /**
     * Create a SqlQuery AST representing inputQuery plus any pushed expressions 
     * of the current node and plus journalization attributes
     * @param inputQuery The upstream AST
     * Copied from LKM_SQL_to_SQL_v2
     */
    protected SqlQuery getTgtSelectQuery(SqlQuery inputQuery) {
        def srcTechno      = physicalNode.getAPNodeSourceExUnit().getLocation().getTechnology()
        def destTechnoName = physicalNode.getExecutionUnit().getLocation().getTechnology().getInternalName()
        def isToHBase      = destTechnoName.equalsIgnoreCase("HBASE")
        def isToFile       = destTechnoName.equalsIgnoreCase("FILE")
        def isFromOracle   = srcTechno.getInternalName().equalsIgnoreCase("ORACLE")
        def isFromTeradata = srcTechno.getInternalName().equalsIgnoreCase("TERADATA")

        List<ISelectItem> newSelectList = new ArrayList<ISelectItem>();
        List<StringExpression> newAliasList = new ArrayList<StringExpression>();

        // Called from a *direct* load LKM?
        if ( physicalNode.isDirectLoad() ) {
            def targetNode = physicalNode.getParentNode()
            List<MapAttribute> attrs = targetNode.getLogicalComponent().getAttributes();
            for (MapAttribute attr : attrs) {
                // for each target attribute, either create an array expression node that represents a simple reference to the attribute...
                if (attr.isMapped()) {                            
                    //TODO: Adding object delimiters is not a task for KMs! This should be 
                    //handled transparently inside the codegen, by moving the respective task
                    //to source side. Which currently fails with NPE.
                    def aliasName = attr.getName()
                    // for HBase targets we need to remove the column family name
                    if (isToHBase) {
                        def idx = aliasName.indexOf( ':' )
                        if ( idx > 0 )
                            aliasName = aliasName.substring( idx+1 )
                    }
                    // Add double quotes when needed
                    // Standard double-quoting rules for non-HBase targets
                    // Force double-quoting for HBase targets, as we must ensure that alias names
                    // do not get upper or lower cased by source database
    	            aliasName = MapAttribute.getSQLAccessName(srcTechno, aliasName, isToHBase )

                    newSelectList.add(new ArrayExpression(targetNode, attr, null, inputQuery));
                    newAliasList.add(new StringExpression( aliasName )); 
                } else {
                    // or an empty string expression for unmapped columns
                    if ( isToFile ) {
                        def unmappedValue = "''"
                        if ( isFromOracle )
                            unmappedValue = "null"
                        if ( isFromTeradata )
                            unmappedValue = "'null'"
                        // for file targets, we need to include even unmapped columns
                        // for HBase we must not include unmapped columns
                        newSelectList.add(new StringExpression(unmappedValue));
                        newAliasList.add(new StringExpression(attr.getName(),attr)); 
                    }
                }
            }
        } else {
            // Called from a standard LKM
            List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();                	
            for (MapPhysicalColumn col : cols) {
                // for each phys column (attribute), create an array expression node that represents a simple reference to the attribute
                newSelectList.add(new ArrayExpression(col, inputQuery));
                newAliasList.add(new StringExpression(col.getName(),col)); 
            }
        }

        /*
        JRNInfo jrnInfo = generatorContext.getJRNInfo();
        List<IColumn> virtualColumns = null;
        if (jrnInfo != null && jrnInfo.hasJrn()) {
            virtualColumns = jrnInfo.getJRNVirtualColumns();
    	    if (virtualColumns != null) {
    	        String jrnTableName = inputQuery instanceof SetQuery ? "" : jrnInfo.getJRNTable().getName() + ".";
    	        for (IColumn virtCol : virtualColumns) {
    	        // for each phys column (attribute), create an array expression node that represents a simple reference to the attribute
    	        newSelectList.add(new StringExpression(jrnTableName + virtCol.getName()));
    	        newAliasList.add(new StringExpression(virtCol.getName())); 
    	    	}
    	    }
        }
        */

        SqlQuery result = inputQuery.clone();
        result.setSelectList(newSelectList);
        result.setAliasList(newAliasList);
        return result;
    }


    /**
     * Create a SqlQuery AST of this AP for downstream use
     * @param tableAlias alias of the C$ table
     * Copied from LKM_SQL_to_SQL_v2
     */
    protected List<ISelectItem> getSelectExprListTarget(String tableAlias) {
    	List<ISelectItem> result = new ArrayList<ISelectItem>();
    	List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();
    	for (MapPhysicalColumn col : cols) {
    		// For regular physical columns, the reference object will be the original source attribute.
    		// For columns that wrap pushed physical expressions, the reference object will be the original logical expression.  
    		// The attribute cannot be used because each attribute might have multiple expression (e.g. set component),
    		// which leads to ambiguity if the attribute is used as the ref object.
            result.add( new StringExpression(col.getSQLAccessName(tableAlias), col, col.getRefObject()) )
    	}
     	// Add extra expressions for expressions that have been pushed up or downstream to this execution unit/PAP
        //List<MapPhysicalExpression> physExprs = physicalNode.getPushedToExpressions()
        //for (MapPhysicalExpression physExpr : physExprs) {
        //    result.add(new ArrayExpression(physicalNode, physExpr, (SqlQuery)null))
        //}
    	return result;
    }


    /* Copied from LKM_SQL_to_SQL_v2 */
    protected AbstractSyntaxTree LKM_SQL_to_SQL_v2__SELECT( String workTableAccessName ) {
      // inputs are ignored for source query formation
      SqlQuery result = new SqlQuery(physicalNode.getTemplateUtils(true))
      // Get the previously stored collection table name for use in downstream select.  
      // "generatorContext" is a predefined variable.
      String accessName = (workTableAccessName==null)? generatorContext.getAPNodeCollTableAccessName() : workTableAccessName
      def tableName = physicalNode.getBoundObjectName();// The name of the associated datastore object
      def tableQualifier = physicalNode.getLocation() == null ? null : physicalNode.getLocation().getName()
      def tableAlias = generatorContext.generateUniqueAlias(physicalNode)
      Table srcTable = new Table(tableName, null, accessName)
      // Pass along the journalized source node to the staged query, if any.
      MapPhysicalNode jrnSource = generatorContext.getAPNodeJournalizedSource()
      result.setJournalizedSource(jrnSource)
      String tableAliasSeparator = physicalNode.getExecutionTechnology().getTableAliasSeparator()
      FromClause from = new FromClause(new TableReference(srcTable), tableAlias, tableAliasSeparator == null ? " " : tableAliasSeparator)
      List<FromClause> fromList = new ArrayList<FromClause>()
      fromList.add(from)
      result.setFromList(fromList)
      result.setSelectList(getSelectExprListTarget(tableAlias))
      return result
    }

    protected AbstractSyntaxTree LKM_SQL_to_SQL_v2__SELECT() {
        return LKM_SQL_to_SQL_v2__SELECT( null )
    }

}
